import React, { Component } from 'react'

export class Main extends Component {
    render() {
        return (
            <div>
                <form onSubmit={this.props.handleSubmit}>
                <h3>Expense: <input type='text' onChange={this.props.handleExpense} name='spend'></input> </h3>
                    <h3>(+sign)Earning:<input type='text' onChange={this.props.handleEarning} name='earn'></input></h3>
                    <br/>
                    <br/>
                    <button><h2>Submit</h2></button>
                </form>
                <br/> <br/> <br/> <br/>
                <h3 style={{color:"green"}}>Total Earning={this.props.earning}
                <br/></h3>
                <h3 style={{color:"red"}}>Total Expenses={-this.props.expense}</h3>
                <br/>

            </div>
        )
    }
}

export default Main
